                        interrupt_map[i].name == "ddr2_pll_frechange_tot_done_intr") begin
                        sources.push_back(interrupt_map[i]);
                    end
                end
                // Add CSUB PLL frechange_tot_done interrupts
                foreach (interrupt_map[i]) begin
